u043a\u0448\u0435\u0433\u043e \u043f\u043e\u0436\u0430\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1773_%D0%B3%D0%BE%D0%B4\" title=\"1773 \u0433\u043e\u0434\">1773<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u043f\u0440\u0438\u043d\u044f\u043b \u00ab\u0447\u0430\u0439\u043d\u044b\u0439 \u0430\u043a\u0442\u00bb, \u0440\u0430\u0437\u0440\u0435\u0448\u0430\u0432\u0448\u0438\u0439 \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0435\u0439\u0441\u044f \u043d\u0430 \u0433\u0440\u0430\u043d\u0438 \u0431\u0430\u043d\u043a\u0440\u043e\u0442\u0441\u0442\u0432\u0430 \u041e\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u0432\u0432\u0435\u0437\u0442\u0438 \u0432 \u0441\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u043a\u043e\u043b\u043e\u043d\u0438\u0438 \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0431\u0435\u0441\u043f\u043e\u0448\u043b\u0438\u043d\u043d\u043e \u043f\u043e\u043b\u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u0444\u0443\u043d\u0442\u043e\u0432 \u0447\u0430\u044f. \u042d\u0442\u043e \u043f\u043e\u0434\u0440\u044b\u0432\u0430\u043b\u043e \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043c\u0435\u0441\u0442\u043d\u044b\u0445 \u043a\u0443\u043f\u0446\u043e\u0432-\u043e\u043f\u0442\u043e\u0432\u0438\u043a\u043e\u0432, \u0432\u0435\u043b\u043e \u043a \u043c\u043e\u043d\u043e\u043f\u043e\u043b\u044c\u043d\u043e\u043c\u0443 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044e \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u043d\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0440\u044b\u043d\u043a\u0435 \u0438 \u0432\u044b\u0437\u0432\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%87%D0%B0%D0%B5%D0%BF%D0%B8%D1%82%D0%B8%D0%B5\" title=\"\u0411\u043e\u0441\u0442\u043e\u043d\u0441\u043a\u043e\u0435 \u0447\u0430\u0435\u043f\u0438\u0442\u0438\u0435\">\u0430\u043a\u0446\u0438\u0438 \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430<\/a> \u043a\u043e\u043b\u043e\u043d\u0438\u0441\u0442\u043e\u0432. \u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u0438\u043d\u044f\u0442\u044b\u0445 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439 \u0436\u0451\u0441\u0442\u043a\u0438\u0445 \u043e\u0442\u0432\u0435\u0442\u043d\u044b\u0445 \u043c\u0435\u0440 \u0432\u0441\u043f\u044b\u0445\u043d\u0443\u043b\u0430 \u0432\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0432\u0440\u0443\u0447\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0443<\/a> \u043d\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 I<\/a> \u0441 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%9F%D0%BE%D0%BC%D0%B5%D1%80%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u041f\u043e\u043c\u0435\u0440\u0430\u043d\u0438\u044f\">\u0428\u0432\u0435\u0434\u0441\u043a\u043e\u0439 \u041f\u043e\u043c\u0435\u0440\u0430\u043d\u0438\u0438<\/a>, \u043f\u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0439, \u0441\u043e\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D1%86%D0%B8%D0%B3\" class=\"mw-redirect\" title=\"\u0414\u0430\u043d\u0446\u0438\u0433\">\u0434\u0430\u043d\u0446\u0438\u0433\u0441\u043a\u043e\u0433\u043e<\/a> \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0430 \u0438 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u044f \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438 \u0441 \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0434\u0435\u0440\u0436\u0430\u0432\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442-\u0443\u0442\u043e\u043f\u0438\u0441\u0442 \u0420\u043e\u0431\u0435\u0440\u0442 \u041e\u0443\u044d\u043d (Robert Owen) \u043e\u0441\u043d\u043e\u0432\u0430\u043b \u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0435 \u043a\u043e\u043b\u043e\u043d\u0438\u044e, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043d\u0430\u0437\u0432\u0430\u043b \u041d\u043e\u0432\u043e\u0439 \u0413\u0430\u0440\u043c\u043e\u043d\u0438\u0435\u0439. \u041e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u0435\u0432 \u043e\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u0434\u0430\u043b\u0435\u043a\u043e \u043d\u0435 \u0433\u0430\u0440\u043c\u043e\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438, \u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828 \u0433\u043e\u0434\u0443<\/a> \u041e\u0443\u044d\u043d \u0431\u044b\u043b \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d \u0441\u0432\u0435\u0440\u043d\u0443\u0442\u044c \u0441\u0432\u043e\u044e \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%BE%D0%BF%D0%B0%D1%80%D0%BA\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u0437\u043e\u043e\u043f\u0430\u0440\u043a\">\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u0437\u043e\u043e\u0441\u0430\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1855_%D0%B3%D0%BE%D0%B4\" title=\"1855 \u0433\u043e\u0434\">1855<\/a>&#160;\u2014 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%B8%D0%B7%D0%B4%D0%B0%D1%82\" title=\"\u0421\u0430\u043c\u0438\u0437\u0434\u0430\u0442\">\u0441\u0430\u043c\u0438\u0437\u0434\u0430\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1861_%D0%B3%D0%BE%D0%B4\" title=\"1861 \u0433\u043e\u0434\">1861<\/a><ul><li>\u041f\u043e\u0441\u043b\u0435 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u044f\">\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u0438<\/a> \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0412\u0438\u0440\u0433\u0438\u043d\u0438\u044f\">\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0412\u0438\u0440\u0433\u0438\u043d\u0438\u04