"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-18_%D0%B2_%D0%A1%D0%B2%D0%B5%D1%80%D0%B4%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B5_(1960)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435 (1960)\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435<\/a>, \u043f\u043e\u0433\u0438\u0431 1 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8C%D0%B5%D1%80%D1%80%D0%B0-%D0%9B%D0%B5%D0%BE%D0%BD%D0%B5\" title=\"\u0421\u044c\u0435\u0440\u0440\u0430-\u041b\u0435\u043e\u043d\u0435\">\u0421\u044c\u0435\u0440\u0440\u0430-\u041b\u0435\u043e\u043d\u0435<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963_%D0%B3%D0%BE%D0%B4\" title=\"1963 \u0433\u043e\u0434\">1963<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0438\u0431\u044b\u043b \u043b\u0438\u0434\u0435\u0440 \u041a\u0443\u0431\u0438\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%81%D1%82%D1%80%D0%BE,_%D0%A4%D0%B8%D0%B4%D0%B5%D0%BB%D1%8C\" title=\"\u041a\u0430\u0441\u0442\u0440\u043e, \u0424\u0438\u0434\u0435\u043b\u044c\">\u0424\u0438\u0434\u0435\u043b\u044c \u041a\u0430\u0441\u0442\u0440\u043e<\/a>. \u0421 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u043e\u0441\u0442\u0440\u043e\u0432\u0430 \u0421\u0432\u043e\u0431\u043e\u0434\u044b<\/a>\u00bb \u043e\u043d \u0432\u044b\u043b\u0435\u0442\u0435\u043b \u0442\u0430\u0439\u043d\u043e, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u043d\u0435\u043b\u044c\u0437\u044f \u0431\u044b\u043b\u043e \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u00ab\u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e\u0439\u00bb \u0430\u0442\u0430\u043a\u0438 \u0435\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u044b \u043f\u0435\u0440\u0432\u044b\u0435 \u043e\u0434\u043d\u043e\u0440\u0430\u0437\u043e\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B3%D1%83%D0%B7%D0%BD%D0%B8%D0%BA\" title=\"\u041f\u043e\u0434\u0433\u0443\u0437\u043d\u0438\u043a\">\u043f\u043e\u0434\u0433\u0443\u0437\u043d\u0438\u043a\u0438<\/a>&#160;\u2014 \u00ab\u041f\u0430\u043c\u043f\u0435\u0440\u0441\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0435<\/a> \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0438\u0441\u044c \u0440\u0438\u043c\u0441\u043a\u0438\u0439 \u043f\u0430\u043f\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_VI_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0430\u0432\u0435\u043b VI (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0430\u0432\u0435\u043b VI<\/a> \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b \u0421\u0421\u0421\u0420 \u0410\u043d\u0434\u0440\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%BE%D0%BC%D1%8B%D0%BA%D0%BE,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0440\u043e\u043c\u044b\u043a\u043e, \u0410\u043d\u0434\u0440\u0435\u0439 \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\">\u0413\u0440\u043e\u043c\u044b\u043a\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-18_%D0%BF%D0%BE%D0%B4_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D0%BE%D0%BC_(1974)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u043f\u043e\u0434 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c (1974)\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u043f\u043e\u0434 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 108 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u04