043d\u0438\u0438 1975 \u0433\u043e\u0434\u0430\">\u0433\u043e\u043d\u043a\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0-1\" title=\"\u0424\u043e\u0440\u043c\u0443\u043b\u0430-1\">\u0424\u043e\u0440\u043c\u0443\u043b\u044b-1<\/a> \u0432 \u043f\u0435\u0440\u0432\u044b\u0439 \u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0430\u0437 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%BD%D0%B0%D1%87%D0%B8%D1%81%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%BE%D1%87%D0%BA%D0%BE%D0%B2_%D0%B2_%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B5-1\" title=\"\u0421\u0438\u0441\u0442\u0435\u043c\u0430 \u043d\u0430\u0447\u0438\u0441\u043b\u0435\u043d\u0438\u044f \u043e\u0447\u043a\u043e\u0432 \u0432 \u0424\u043e\u0440\u043c\u0443\u043b\u0435-1\">\u0437\u0430\u0447\u0451\u0442\u043d\u044b\u0435 \u043e\u0447\u043a\u0438<\/a> \u043d\u0430\u0431\u0440\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D0%B8,_%D0%9B%D0%B5%D0%BB%D0%BB%D0%B0\" title=\"\u041b\u043e\u043c\u0431\u0430\u0440\u0434\u0438, \u041b\u0435\u043b\u043b\u0430\">\u0436\u0435\u043d\u0449\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0410\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f<\/a>) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0435<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B5\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0435\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B5_(%D1%81_2015)\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432 \u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0435 (\u0441 2015)\">\u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0449\u0435\u0439\u0441\u044f \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u044d\u0432\u0430\u043a\u0443\u0430\u0446\u0438\u044f \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B8%D0%BF%D1%8F%D1%82%D1%8C_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041f\u0440\u0438\u043f\u044f\u0442\u044c (\u0433\u043e\u0440\u043e\u0434)\">\u041f\u0440\u0438\u043f\u044f\u0442\u044c<\/a> \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B1%D1%8B%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%B2%D0%B0%D1%80%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0427\u0435\u0440\u043d\u043e\u0431\u044b